class CatGPTTest(unittest.TestCase):
    def test_1(self):
        sentences = ["abc", "abazacy", "dbcef", "xzz", "gdbc", "abazacy", "xyz", "abazacy", "dbcef", "xyz", "xxx", "xzz"]
        mycattrie = CatsTrie(sentences)
        self.assertEqual(mycattrie.autoComplete("ab"), "abazacy")
        self.assertEqual(mycattrie.autoComplete("a"), "abazacy")
        self.assertEqual(mycattrie.autoComplete("dbcef"), "dbcef")
        self.assertIsNone(mycattrie.autoComplete("dbcefz"))
        self.assertIsNone(mycattrie.autoComplete("ba"))
        self.assertEqual(mycattrie.autoComplete("x"), "xyz")
        self.assertEqual(mycattrie.autoComplete(""), "abazacy")
    
    def test_2(self):
        sentences = ["abc", "abazacy", "dbcef", "xzz", "gdbc", "abazacy", "xyz", "abazacy", "dbcef", "xyz", "xxx", "xzz"]
        mycattrie = CatsTrie(sentences)
        self.assertIsNone(mycattrie.autoComplete("dbcefz"))
        self.assertIsNone(mycattrie.autoComplete("ba"))
        self.assertIsNone(mycattrie.autoComplete("nonexistent"))
        self.assertEqual(mycattrie.autoComplete("xyz"), "xyz")
        self.assertEqual(mycattrie.autoComplete("xzz"), "xzz")
        self.assertEqual(mycattrie.autoComplete("xx"), "xxx")
        

    
    def test_4(self):
        sentences = ["def", "abcxyz", "ab", "xyz", "abcdef", "defxyz", "x"]
